import java.util.*;

public class CacheHitRate {
    public static void main(String[] args) {
        SparkConf conf = new SparkConf().setAppName("CacheHitRate");
        JavaSparkContext sc = new JavaSparkContext(conf);

        // Load onsite attributed data
        JavaRDD<String[]> onsiteData = sc.textFile("onsite_data.txt")
                .map(line -> line.split(","))
                .map(arr -> new String[]{arr[0], arr[1]});

        // Load top frequent queries
        JavaRDD<String> topFrequentQueries = sc.textFile("top_frequent_queries.txt")
                .map(line -> line.split(",")[0]);

        // Join onsite data with top frequent queries
        JavaPairRDD<String, String[]> onsiteDataWithQuery = onsiteData.mapToPair(new PairFunction<String[], String, String[]>() {
            @Override
            public Tuple2<String, String[]> call(String[] s) throws Exception {
                return new Tuple2<>(s[0], s);
            }
        }).join(topFrequentQueries.map(new Function<String, Tuple2<String, String>>() {
            @Override
            public Tuple2<String, String> call(String s) throws Exception {
                return new Tuple2<>(s, s);
            }
        }));

        // Calculate cache hit rate
        JavaRDD<String> cacheHits = onsiteDataWithQuery.filter(new Function<Tuple2<String, String[]>, Boolean>() {
            @Override
            public Boolean call(Tuple2<String, String[]> t) throws Exception {
                // Check if query is present in top frequent queries
                if (topFrequentQueries.collectAsList().contains(t._1())) {
                    // Check if it's first time the system would count this as a cache miss
                    // If it's first time, send a request to retrieve such query and cache in the memory for 12 hours
                    // Then next time the same query comes, it would be a cache hit
                    // For simplicity, let's assume it's a cache hit
                    return true;
                }
                return false;
            }
        });

        // Calculate cache hit rate
        double cacheHitRate = cacheHits.count() / onsiteData.count();

        System.out.println("Cache Hit Rate: " + cacheHitRate);
    }
}
